21:15 &quot;Wir hatten Sachen wie Futter für die Hühner und für die Gänse und für die Schafe und die Ziegen, die wir zwischendruch hatten. Auch für den Hund und für die Katzen. Das alles habe ich nicht mehr&quot;
JA weil DU sie VERHUNGERN ließt! Der Hund wurde abgeholt vom Amt (nicht weil die Hater es dir nicht gönnen, sondern) weil du ihn vernachlässigt hast! Und du wunderst dich, warum man dir die Katzen weggenommen hat, nachdem du alle anderen Tiere inklusive deine Hamster vernachlässigt hast?
Es ist ein Wunder, dass du nicht bereits für den Tod deiner Hühner und Tauben im Stall angezeigt wurdest. Dafür kriegst du dein Fett von deinen Besuchern zurück (und auch bald von deinen Genossen im Knast).
